  for households, businesses, and industries in the City of Chicago during 2010. Electric
  \ The data was aggregated from ComEd and Peoples Natural Gas by Accenture. Electrical
  and gas usage data comprises 88 percent of Chicago's buildings in 2010. The electricity
  data comprises 68 percent of overall electrical usage in the city while gas data
  comprises 81 percent of all gas consumption in Chicago for 2010.rnrnCensus blocks
  with less than 4 accounts is displayed at the Community Area without further geographic
  identifiers. This dataset also contains selected variables describing selected characteristics
  of the Census block population, physical housing, and occupancy.\",\n\t\"license_title\":
